        marks: 776.83,
        Image: ()=>{
            return (
            <img src= "/images/man 1.jpg" />
            );
        } 
    },

    {
        student_name: "kathe taylor",
        class: "BS Commerce",
        college: "Punjab",
        marks: 976.83,
        Image: ()=>{
            return (
                <img src="/images/man 2.jpg" />
            );
        } 
    },

    {
        student_name: "guptil ben",
        class: "BSIT",
        college: "Concordia",
        marks: 796.83,
        Image: ()=>{
            return (
            <img src= "/images/woman.jpg" />
            );
        }  
    }
]


export default data;
